import { split } from "lodash";
import * as Function from "../func";

function MyPage(){
    const userInfo = Function.Fetching("user");

    if(!userInfo) { return <div> Loading ... </div> }
    else {
        return (
            <div id="div-box">
                <h1>MY PAGE</h1><hr/>
                <b> User Code : </b><span> {userInfo.code} </span>
                <b> User Name : </b><span> {userInfo.username} </span>
                <b> PassWord : </b><span> {userInfo.password} </span>
                <b> ROLE : </b><span> {split(userInfo.authorities[0].authority)[0]} </span>
                {console.log(userInfo.code)}
                {console.log(userInfo.username)}
                {console.log(userInfo.password)}
                {console.log(userInfo.authorities[0].authority)}
                {/* <textarea value={Function.Fetching("user")}>  </textarea> */}
            </div>
        )
    }
}

export default MyPage
